INSERT INTO `drupal_variable` VALUES ('user_mail_register_admin_created_subject','s:52:\"An administrator created an account for you at !site\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_register_admin_created_body','s:468:\"!username,\r\n\r\nA site administrator at !site has created an account for you. You may now log in to !login_uri using the following username and password:\r\n\r\nusername: !username\r\npassword: !password\r\n\r\nYou may also log in by clicking on this link or copying and pasting it in your browser:\r\n\r\n!login_url\r\n\r\nThis is a one-time login, so it can be used only once.\r\n\r\nAfter logging in, you will be redirected to !edit_uri so you can change your password.\r\n\r\n\r\n--  !site team\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_register_no_approval_required_subject','s:38:\"Account details for !username at !site\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_register_no_approval_required_body','s:442:\"!username,\r\n\r\nThank you for registering at !site. You may now log in to !login_uri using the following username and password:\r\n\r\nusername: !username\r\npassword: !password\r\n\r\nYou may also log in by clicking on this link or copying and pasting it in your browser:\r\n\r\n!login_url\r\n\r\nThis is a one-time login, so it can be used only once.\r\n\r\nAfter logging in, you will be redirected to !edit_uri so you can change your password.\r\n\r\n\r\n--  !site team\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_register_pending_approval_subject','s:63:\"Account details for !username at !site (pending admin approval)\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_register_pending_approval_body','s:273:\"!username,\r\n\r\nThank you for registering at !site. Your application for an account is currently pending approval. Once it has been approved, you will receive another e-mail containing information about how to log in, set your password, and other details.\r\n\r\n\r\n--  !site team\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_password_reset_subject','s:52:\"Replacement login information for !username at !site\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_password_reset_body','s:419:\"!username,\r\n\r\nA request to reset the password for your account has been made at !site.\r\n\r\nYou may now log in to !uri_brief by clicking on this link or copying and pasting it in your browser:\r\n\r\n!login_url\r\n\r\nThis is a one-time login, so it can be used only once. It expires after one day and nothing will happen if it\'s not used.\r\n\r\nAfter logging in, you will be redirected to !edit_uri so you can change your password.\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_status_activated_notify','i:1;');
INSERT INTO `drupal_variable` VALUES ('user_mail_status_activated_subject','s:49:\"Account details for !username at !site (approved)\";');
INSERT INTO `drupal_variable` VALUES ('user_mail_status_activated_body','s:434:\"!username,\r\n\r\nYour account at !site has been activated.\r\n\r\nYou may now log in by clicking on this link or copying and pasting it in your browser:\r\n\r\n!login_url\r\n\r\nThis is a one-time login, so it can be used only once.\r\n\r\nAfter logging in, you will be redirected to !edit_uri so you can change your password.\r\n\r\nOnce you have set your own password, you will be able to log in to !login_uri in the future using:\r\n\r\nusername: !username\r\n\";');
